import './App.css';
import Navbar from './components/Navbar/Navbar'
import { StudentData } from './components/StudentData/Index'
import StudentData1 from './components/StudentData/StudentData1';
import StudentData2 from './components/StudentData/StudentData2';

function App() {
  return (
    <div className="App">
     <Navbar />
     <StudentData>
      <StudentData1 />
      <StudentData2 />
      </StudentData> 
    </div>
  );
}

export default App;
